import React from 'react'
import './PatientScreen.css'

 const PatientScreen = ({patient, route}) => {
    return (
        <div className='patient-cont'>
            <p>First Name:{patient.first_name} Last Name: {patient.last_name}</p>
        </div>
    )
}

export default PatientScreen;
